eval("module.exports = JSON.parse(\"{\\\"Header\\\":{\\\"MainTitle\\\":\\\"chuo university soft tennis team\\\",\\\"AssistanceTitle\\\":\\\"中央大学ソフトテニス部\\\",\\\"NavItem\\\":[\\\"Top\\\",\\\"Club\\\",\\\"Member\\\",\\\"Hakumonkai\\\",\\\"History\\\",\\\"Photo\\\",\\\"Contact\\\"]},\\\"Footer\\\":{\\\"Information\\\":{\\\"ClubName\\\":\\\"クラブ名：中央大学ソフトテニス部\\\",\\\"Address\\\":\\\"住所：東京都八王子市東中野742-1\\\",\\\"TelephoneNumber\\\":\\\"TEL：042‐594‐4243\\\",\\\"MailAddress\\\":\\\"MAIL：xxxxxxxxxxxxx@gmail.com\\\",\\\"Caretaker\\\":\\\"管理人：村上 博之\\\"},\\\"EndText\\\":\\\"@ Chuo University Soft Tennis Team\\\"},\\\"TeamDescription\\\":\\\"中央大学では、20名前後の選手が在籍し、全国各地から個性的な選手が集まっています。強みや特徴は個人によって様々、まさに十人十色といったチームです。メリハリをつけ、「やるときはやる」という雰囲気を大切に活動しています。様々なキャラクターの選手がチームのピースとなり、時にはぶつかり、励ましあう中で目標に向かって突き進んでいます。\\\",\\\"HakumonkaiDescription\\\":\\\"白門とは昭和初年頃からの中央大学の象徴です。長い歴史の中でも白門は色あせず、現代でも根付く中央大学の誇りです。白門を叩き、白門から飛び立った先輩達を本大学は「白門会」と名付けています。ソフトテニス部白門会は、歴史と伝統を受け継ぎ、中央大学の名を背負い戦う選手たちを応援します。\\\",\\\"Support\\\":\\\"中央大学ソフトテニス部は、幅広い方々のサポートの下活動しています。\\\\n中央大学、OB、メーカー様、その他関係者様の手厚いサポートを賜り、ソフトテニスに100%コミットできる環境づくりと円滑な部活動運営が可能となっています。各関係者様の多大なサポートとご協力に感謝し、謙虚かつ真摯な姿勢を忘れずに活動して参ります。\\\",\\\"practiceAttentionText\\\":\\\"※練習時間・活動期間・オフについては年度や体制、状況によって変動します。\\\"}\");//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,eyJ2ZXJzaW9uIjozLCJzb3VyY2VzIjpbXSwibmFtZXMiOltdLCJtYXBwaW5ncyI6IiIsImZpbGUiOiIuL3Jlc291cmNlcy9qcy9jb25maWcvbWVzc2FnZXMuanNvbi5qcyIsInNvdXJjZVJvb3QiOiIifQ==\n//# sourceURL=webpack-internal:///./resources/js/config/messages.json\n");

